import { useState, useEffect } from "react";
import { Box, Stack, Typography } from "@mui/material";
const Feed = () => {
  <Stack sx={{ flexDirection: { sx: "column", md: "row" } }}></Stack>;
  <Box
    sx={{
      hieght: { sx: "auto", md: "92vh" },
      borderRight: "1px solid #3d3d3d",
      px: { sx: 0, md: 2 },
    }}
  ></Box>;
};

export default Feed;
